import BNB from '../../../assets/coins/BNB.svg';
import Wallet from '../../../assets/icons/Wallet.svg'
import Header from '../../layout/Header';
import FixedBottomNavigation from '../../layout/Footer'
import DrawerLayout from '../../layout/Drawer/DrawerLayout';
import Whatsapp from '../../../assets/icons/Whatsapp.svg';

const Settings = () => {

  const { userData, setUserData } = useContext(UserContext);
  console.log(userData)

  const user = userData.user?.displayName;
  console.log(user);

  return (
    <>
      <DrawerLayout>
      <Grid container >
        <Grid item xs={12}>
          <h1 className='welcome'>Soporte: <img src={Whatsapp} alt='' width='150px' /></h1>
        </Grid>
        
      </Grid>
      <label>Dolar Hoy: 1USD = 0.89EUR</label>
      </DrawerLayout>
    </>
  )
}

export default Settings;
